import React from 'react';
import {createDrawerNavigator} from '@react-navigation/drawer';
import {NavigationContainer}from '@react-navigation/native';

import {AuthStack} from './AuthStack';
import { EditSingle, HomeScreen } from '../screens';

const {Navigator,Screen} =  createDrawerNavigator();
export const RootDrawer = () =>{
    return(
        <NavigationContainer>
            <Navigator> 
                <Screen  name={'ADD NEW LIST'} component={HomeScreen}/>
                <Screen  name={'ONE TIME LIST'} component={EditSingle}/>
                <Screen  name={'REGULAR LISTS'} component={EditSingle}/>
                <Screen  name={'USER SETTINGS'} component={HomeScreen}/>

            </Navigator>
        </NavigationContainer>
    )
}
